import React,{Component} from 'react';
import './dashboard.css';
import Menu from '../menu/menu';
import {Redirect,NavLink} from 'react-router-dom';

class Dashboard extends Component{
    
    //  componentWillMount(){
    //   const receivedData=localStorage.getItem(JSON.stringify(isLoggedin)); 
    //      if(!receivedData){
    //         this.props.history.push("/")
    //      } 
    //  }
    render(){
       
        if (localStorage.getItem('isLoggedIn') === null) {
            return <Redirect to='/login' />
          }
        else{
         return(
            <div >
        <Menu />
     {/* <div className="dashoardImg">     
        <h2>Welcome to Capability Test App</h2>
        </div> */}
    <main class="grid">
        <NavLink to='/menu/questions' className="tiles" >
  <div className="tiles">
    <img src={require('.././1.jpg')} alt="Sample photo" />
    <div className="text">
    <button>SQL</button>
    </div>
    </div>    
 </NavLink>
 <NavLink to='/menu/questions' className="tiles" >
  <div className="tiles">
    <img src={require('.././1.jpg')} alt="Sample photo" />
    <div className="text">
    <button>SQL</button>
    </div>
    </div>    
 </NavLink>
 <NavLink to='/menu/questions' className="tiles" >
  <div className="tiles">
    <img src={require('.././sql2.png')} alt="Sample photo" />
    <div className="text">
    <button>SQL</button>
    </div>
    </div>    
 </NavLink>
 <NavLink to='/menu/questions' className="tiles" >
  <div className="tiles">
    <img src={require('.././sql2.png')} alt="Sample photo" />
    <div className="text">
    <button>SQL</button>
    </div>
    </div>    
 </NavLink>
 <NavLink to='/menu/questions' className="tiles" >
  <div className="tiles">
    <img src={require('.././sql2.png')} alt="Sample photo" />
    <div className="text">
    <button>SQL</button>
    </div>
    </div>
     </NavLink>
     <NavLink to='/menu/questions' className="tiles" >
  <div className="tiles">
    <img src={require('.././sql2.png')} alt="Sample photo" />
    <div className="text">
    <button>SQL</button>
    </div>
    </div>    
 </NavLink>
 
 </main>
</div>   
    )
    }
             }
 
}
export default Dashboard;
